import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class WebBackendService {
  myArray: Array<any>;
  constructor(private http: HttpClient) {
    this.myArray = [];
  }
  getData() {
    return this.http.get("http://10.0.0.43:7096/");
  }
  searchName(name: string) {
    return this.http.post("http://10.0.0.43:7096/api/nameSearch", { name: name},);
  }
  searchGenre(genreId: number) {
    return this.http.post("http://10.0.0.43:7096/api/genre", { genreId: genreId });
  }
  getGameCover(coverID: number) {
    return this.http.post("http://10.0.0.43:7096/api/gameCovers", { coverid: coverID })
  }
  getGenreNames(genreIDs: number[]){
    return this.http.post("http://10.0.0.43:7096/api/genreNames", { genreids: genreIDs })
  }
}
